webpackJsonp([8087260763609],{910:function(e,a){e.exports={data:{markdownRemark:{fileAbsolutePath:"/home/alan/dev/angeloocana/src/pages/blog/linux/arch/backup-android-files.en.md",html:'<p>Is your Android mobile FULL? Backup your data to your Arch Linux.\nIt is easy following my steps (I hope hahaha).\nI had some trouble with other programs (android-file-transfer e mtpfs),\nso here it goes what works for me:</p>\n<h2>Install simple-mtpfs</h2>\n<p>If you do not have or know what is <strong>Yaourt</strong>, please check it out:\n<a href="https://angeloocana.com/en/blog/linux/arch/install-yaourt/">https://angeloocana.com/en/blog/linux/arch/install-yaourt/</a></p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>    yaourt -S simple-mtpfs\n</code></pre>\n      </div>\n<h2>Create destination folder</h2>\n<p>I’ll be using <strong>mnt</strong> folder, you can use any name, but remember it for the next step.</p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>    <span class="token function">mkdir</span> ~/mnt\n</code></pre>\n      </div>\n<h2>Mount your Phone to a folder</h2>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>    simple-mtpfs --device 1 ~/mnt\n</code></pre>\n      </div>\n<p>That is it! uhuhuh\nJust go to <strong>~/mnt</strong>, your files will be there!</p>\n<p>Official guide: <a href="https://wiki.archlinux.org/index.php/MTP">https://wiki.archlinux.org/index.php/MTP</a></p>',excerpt:"Is your Android mobile FULL? Backup your data to your Arch Linux.\nIt is easy following my steps (I hope hahaha).\nI had some trouble with…",fields:{tagSlugs:[{tag:"Linux",link:"/en/tags/linux/"},{tag:"Arch",link:"/en/tags/arch/"},{tag:"Android",link:"/en/tags/android/"}],slug:"/en/blog/linux/arch/backup-android-files/",readNextPosts:[{excerpt:"Tests, correct pronunciation, tips and more. Learn and contribute to this collection of free content to learn English. (New links weekly…",frontmatter:{title:"Learn English links",date:"2017-10-16"},fields:{slug:"/en/blog/languages/english/learn-english-links/",langKey:"en"}},{excerpt:"Dicas para cria um excelente código, que vai aumentar sua produtividade, evitar muitas dores de cabeça, e colaborar para um mundo melhor!",frontmatter:{title:"DicaRapida 2 Por um código MELHOR!",date:"2015-04-17"},fields:{slug:"/Tutoriais/DicaRapida_2_Por_Um_Mundo_Melhor/",langKey:"en"}},{excerpt:"",frontmatter:{title:"Functional Programming Examples",date:"2017-06-23"},fields:{slug:"/en/blog/functional-programming/examples/",langKey:"en"}}]},frontmatter:{youtubeId:null,title:"Access and Backup Android Files and Photos",tags:["Linux","Arch","Android"],date:"2017-08-28",structuredData:{type:"TechArticle",author:"angeloocana",dependencies:"Arch Linux and Android Mobile Phone",proficiencyLevel:"Beginner",articleSection:"Arch Linux",pageEnd:null,pageStart:null,pagination:null,about:{name:"Arch Linux",alternateName:"Arch",description:"lightweight and flexible Linux® distribution that tries to Keep It Simple.",identifier:"arch-linux",image:null,sameAs:"https://www.archlinux.org/"},accessMode:"textual",accessModeSufficient:"textual",accessibilityAPI:"ARIA",accessibilityControl:"fullKeyboardControl, fullTouchControl, fullMouseControl",accessibilitySummary:null,aggregateRating:"...",audience:"...",alternativeHeadline:"...",comment:"...",commentCount:"...",contentLocation:"...",dateCreated:"2017-08-26",dateModified:"2017-08-28",datePublished:"2017-08-28",discussionUrl:"...",educationalUse:"...",isAccessibleForFree:!0,isFamilyFriendly:!0,keywords:"...",locationCreated:"Ottawa CA",thumbnailUrl:"...",version:1,video:"..."}}}},pathContext:{path:"/en/blog/linux/arch/backup-android-files/",langKey:"en"}}}});
